pragma solidity ^0.5.0;

import "./OwnableDao.sol";

/** 
 *@dev abstract contract with functions, mappings and events for Registry contract
*/
contract IWfcRegistry is OwnableDao {
    /**
     * @dev mapping with key the name of the logical contract and value its address
     */
    mapping(bytes32 => address) public logicalContracts;

    /**
     * @dev mapping with key the name of the storage contract and value its address
     */
    mapping(bytes32 => address payable) public storageContracts;

    /**
     * @dev mapping with keys storage contract address and logical contract address and value 
     * a bool variable that indicate if the storage contract can receive calls from the logical one
     */
    mapping(address => mapping (address => bool)) public isAllowed;

    enum ContractType {LOGICAL, STORAGE}

    /**
     * @dev function that allows the Dao to add a logical contract in the registry
     */
    function addLogicalContract(string calldata _contractName, address payable _contractAddress) external;

    /**
     * @dev function that allows the Dao to add a storage contract in the registry
     */
    function addStorageContract(string calldata _contractName, address payable _contractAddress) external;

    /**
     * @dev function that allows the Dao to update a logical contract in the registry
     */
    function updateLogicalContract(string calldata _contractName, address payable _newContractAddress) external;

    /**
     * @dev function that allows the Dao to update a storage contract in the registry
     */
    function updateStorageContract(string calldata _contractName, address payable _newContractAddress) external;

    /**
     * @dev function that allows the Dao to delete a logical contract in the registry
     */
    function deleteLogicalContract(string calldata _contractName) external;

    /**
     * @dev function that allows the Dao to delete a storage contract in the registry
     */
    function deleteStorageContract(string calldata _contractName) external;

    /**
     * @dev function that allows to add or eliminate the link between a storage and a logical contract
     */
    function setAllowedContracts (string calldata _storageContractName, string calldata _logicalContractName, bool _isAllowed) external;

    /**
     * @dev function that allows to create a new contract and add it to the registry
     */
    function deployAndAddContract(bytes memory _contractByteCode, uint256 _amount, string memory _contractName, ContractType _contractType) public payable;

    /**
     * @dev function that allows to create a new contract and update it to the registry
     */
    function deployAndUpdateContract(bytes memory _contractByteCode, uint256 _amount, string memory _contractName, ContractType _contractType) public payable;

    /**
     * @dev event emitted when a logical contract is added in the registry
     */
    event AddLogicalContractLog(string indexed _contractName, address indexed _contractAddress);

    /**
     * @dev event emitted when a storage contract is added in the registry
     */
    event AddStorageContractLog(string indexed _contractName, address indexed _contractAddress);

    /**
     * @dev event emitted when a logical contract is updated in the registry
     */
    event UpdateLogicalContractLog(string indexed _contractName, address indexed _previousAddress, address indexed _newContractAddress);

    /**
     * @dev event emitted when a storage contract is updated in the registry
     */
    event UpdateStorageContractLog(string indexed _contractName, address indexed _previousAddress, address indexed _newContractAddress);

    /**
     * @dev event emitted when a link beetween logical contract and storage contract is created or removed
     */
    event SetAllowedContractsLog(address indexed _storageContractName, address indexed _logicalContractName, bool _previous, bool _isAllowed);
}

pragma solidity ^0.5.0;

contract OwnableDao {
    address internal ownerDao;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);
    
    /**
     * @dev The Ownable constructor sets the original `owner` of the contract to the sender
     * account.
     */
    constructor (address _ownerDao) internal {
        require(_ownerDao != address(0));
        ownerDao = _ownerDao;
        emit OwnershipTransferred(address(0), _ownerDao);
    }



    /**
     * @return the address of the owner.
     */
    function getOwnerDao() public view returns (address) {
        return ownerDao;
    }

    /**
     * @dev Throws if called by any account other than the owner.
     */
    modifier onlyOwnerDao() {
        require(isOwnerDao());
        _;
    }

    /**
     * @return true if `msg.sender` is the owner of the contract.
     */
    function isOwnerDao() public view returns (bool) {
        return msg.sender == ownerDao;
    }

   
    /**
     * @dev Allows the current owner to transfer control of the contract to a newOwner.
     * @param newOwnerDao The address to transfer ownership to.
     */
    function transferOwnershipDao(address newOwnerDao) public onlyOwnerDao {
        _transferOwnershipDao(newOwnerDao);
    }

    /**
     * @dev Transfers control of the contract to a newOwner.
     * @param newOwnerDao The address to transfer ownership to.
     */
    function _transferOwnershipDao(address newOwnerDao) internal {
        require(newOwnerDao != address(0));
        emit OwnershipTransferred(ownerDao, newOwnerDao);
        ownerDao = newOwnerDao;
    }
}

pragma solidity ^0.5.0;

import "./utils/StringAsKey.sol";

import "./Registry/IWfcRegistry.sol";

import "./storage/IWfcManagmentStorage.sol";

/**
 * @dev logical contract that allow Dao to interact with the associated storage contract in order
 * to add and update functionalities of the platform
 */
contract WfcManagmentLogical {

    using StringAsKey for string;
	
    /**
     * @dev address of the registry this contract is linked to
     */
    IWfcRegistry public wfcRegistry;
	
	/**
     * @dev name in bytes of storage contract that this contract is linked through the registry
     */
    bytes32 public storageContractName;

    /**
     * @dev event emitted when a token is set
     */	 
    event SetTokenLog(address indexed _tokenAddress, bool _previous, bool _isActivated);

    /**
     * @dev event emitted when a service line is set
     */	
    event SetServiceLineLog(string indexed _ServiceLineName, bool _previous, bool _isActivated);

    /**
     * @dev event emitted when a donation split percentage is set
     */	
    event SetDonationSplitLog(string indexed _donationSplitName, uint256 _previousValue, uint256 newValue);

    /**
     * @dev event emitted when a platform setting is set
     */	
    event SetSettingLog(string indexed _settingName, uint256 _prevoiusSettingValue, uint256 _newSettingValue);
    
    modifier onlyOwnerDao {
        require(msg.sender == wfcRegistry.getOwnerDao(), "Sender different from Dao owner");
        _;
    }

    /**
     * @dev constructor that sets registry address and name of storage contract linked to this contract
     */
    constructor (IWfcRegistry _wfcRegistry, string memory _storageContractName) public {
        require(address(_wfcRegistry) != address(0), "wfcRegistry address is null");
        wfcRegistry = _wfcRegistry;
        storageContractName = _storageContractName.convert();
    }

    /**
     * @dev function that sets if a token is allowed as donation currency
     */
    function setToken (address _tokenAddress, bool _isActivated) external onlyOwnerDao {
        require(_tokenAddress != address(0), "Token address is null");
        IWfcManagmentStorage wfcManagmentStorage = IWfcManagmentStorage(wfcRegistry.storageContracts(storageContractName));
        bool previous = wfcManagmentStorage.getTokenAddress(_tokenAddress);
        wfcManagmentStorage.setTokenAddress(_tokenAddress, _isActivated);
        emit SetTokenLog(_tokenAddress, previous, _isActivated);
    }

    /**
     * @dev function that sets if a service line is allowed 
     */
    function setServiceLine(string calldata _lineName, bool _isActivated) external onlyOwnerDao {
        IWfcManagmentStorage wfcManagmentStorage = IWfcManagmentStorage(wfcRegistry.storageContracts(storageContractName));
        bytes32 lineName = _lineName.convert();
        bool previous = wfcManagmentStorage.getServiceLine(lineName);
        wfcManagmentStorage.setServiceLine(lineName, _isActivated);
        emit SetServiceLineLog(_lineName, previous, _isActivated);
    }
    
    /**
     * @dev function that set the percentage of split of between reserve, 
     * donation, same service line, all service line and the team
     */
    function setDonationSplit(string calldata _donationSplitName, uint256 _splitValue) external onlyOwnerDao {
        IWfcManagmentStorage wfcManagmentStorage = IWfcManagmentStorage(wfcRegistry.storageContracts(storageContractName));
        string memory _totalName = "total";
        bytes32 totalName = _totalName.convert();
        bytes32 donationSplitName = _donationSplitName.convert();
        require(totalName != donationSplitName, "String of donations split equal to total");
        uint256 previousSplitValue = wfcManagmentStorage.getDonationSplit(donationSplitName);
        wfcManagmentStorage.setDonationSplit(donationSplitName, _splitValue);
        emit SetDonationSplitLog(_donationSplitName, previousSplitValue, _splitValue);
        uint256 previousTotalValue = wfcManagmentStorage.getDonationSplit(totalName);
        uint256 newTotalValue = previousTotalValue + _splitValue - previousSplitValue;
        require(newTotalValue < 10000, "Split percentage too high");
        wfcManagmentStorage.setDonationSplit(totalName, newTotalValue);
        emit SetDonationSplitLog(_totalName, previousTotalValue, newTotalValue);
    }

    /**
     * @dev function that set Wfc platform general settings
     */
    function setSetting(string calldata _settingName, uint256 _newSettingValue) external onlyOwnerDao {
        IWfcManagmentStorage wfcManagmentStorage = IWfcManagmentStorage(wfcRegistry.storageContracts(storageContractName));
        bytes32 settingName = _settingName.convert();
        uint256 prevoiusSettingValue = wfcManagmentStorage.getSetting(settingName);
        wfcManagmentStorage.setSetting(settingName, _newSettingValue);
        emit SetSettingLog(_settingName, prevoiusSettingValue, _newSettingValue);
    }
}

